import React from 'react';
import { Provider } from "react-redux"
import store from "./store"
//Vamos a crear nuestro componente principal(Esta es la estructura basica que va a tener nuestra aplicacion)

const App = () => (
    <Provider store={store}>
        <main>
            //va a contener dos componentes
            <h1>Edmanager</h1>
            <Jugadores />
            <EquipoSeleccionado />
        </main>
    </Provider>
   )

export default App;
